import React from 'react'
import backgroundImage from "../image/pic2.jpg";

function LoginComp() {
  return (
    <div>
        <div className=""
      style={{ backgroundImage: `url(${backgroundImage})` }}>
        <div className="absolute top-44 left-96 w-1/2 h-1/2 bg-white drop-shadow-xl rounded-2xl">
        </div>
        </div>
    </div>
  )
}

export default LoginComp
